import React from 'react';
import UserList from '../components/UserList';

const Users = () => {
    const UserList = {
        id: 123,
        name: "General Kenobi",
        image: "data:image/jpeg;base64,",
        places: 4
    }
    return (
        <UserList userList={UserList} />
    )
}

export default Users;
